The first immunoglobulin, the second immunoglobulin, or both, can be chimerized. Conversely, the methods can further comprise chimerizing the first immunoglobulin, chimerizing the second immunoglobulin, or chimerizing both the first immunoglobulin and the second immunoglobulin. For example, and without intending to be limiting, the methods can further comprise, prior to the incubating step:
chimerizing a first immunoglobulin comprising a Cys801 to generate a first chimeric immunoglobulin;
chimerizing the second immunoglobulin comprising a Cys802 to generate a second chimeric immunoglobulin;
decapping the Cys801, Cys802, or both; and
conjugating a first thiol-reactive compound to the Cys801, a second thiol-reactive compound to the Cys802, or both, wherein the first thiol-reactive compound comprises a first thiol-reactive group and the second thiol-reactive compound comprises a second thiol-reactive group.

The first immunoglobulin, the second immunoglobulin, or both, can be humanized. Conversely, the methods can further comprise humanizing the first immunoglobulin, humanizing the second immunoglobulin, or humanizing both the first immunoglobulin and the second immunoglobulin. For example, and without intending to be limiting, the methods can further comprise, prior to the incubating step: humanizing a first immunoglobulin comprising a Cys801 to generate a first humanized immunoglobulin;
humanizing the second immunoglobulin comprising a Cys802 to generate a second humanized immunoglobulin;
decapping the Cys801, Cys802, or both; and
conjugating a first thiol-reactive compound to the Cys801, a second thiol-reactive compound to the Cys802, or both, wherein the first thiol-reactive compound comprises a first thiol-reactive group and the second thiol-reactive compound comprises a second thiol-reactive group.

