To study the effect of the presence or absence of Phe83 in the context of these Vκ families, the CDR regions of 155D5 were genetically grafted onto the human frameworks IGKV1-39*01, IGKV2-40*01, IGKV3-11*01, IGKV4-1*01, IGKV5-2*01, IGKV6-21*01, IGKV6D-41*01, and IGKV7-3*01. IGKV5-2*01 Asn20, which contains an N-linked glycosylation site at residues 20, and its Thr20 variant were not included in this analysis because the former could not be analyzed by mass spectrometry due to heterogeneity, and the latter did not express well. IGKV7-3*01 Asn81 was not included in the analysis because it could not be analyzed by mass spectrometry. However, the variant IGKV7-3*01-Glu81 was included in the analysis. The following results were obtained from the analysis (Table 10):
1. The humanized mAb with the huIGKV1-39 sequence and containing Phe83 showed an aggregation increase from 0 to 26% after decapping; the conjugation efficiency was borderline acceptable (68%) but aggregation being >25% was not;
2. The humanized mAb with the huIGKV2-40 sequence contained a human germline Val83; this mAb showed aggregation <25% after decapping (11%) and conjugation efficiency >70% (92%). These parameters were acceptable, suggesting that the human germline Val83 is conducive to pairing with Cys80 to allow Cys80 conjugation;
3. The humanized mAb with the huIGKV3-11 sequence contained a human germline Phe83; while aggregation was below 25%, conjugation efficiency was 55%, therefore not meeting the criterion of >70%;
4. The humanized mAb with the huIGKV4-1 sequence contained a human germline Val83; this mAb showed aggregation <25% after decapping (6%) and conjugation efficiency >70% (82%). These parameters were acceptable, suggesting that the human Val83 is conducive to pairing with Cys80 to allow Cys80 conjugation, as seen with the huIGKV2-40 sequence;
5. The humanized mAbs with the huIGKV6-21 or huIGKV6D-41 sequences both contained a human germline Ala83; these mAbs showed aggregation <25% after decapping and conjugation efficiency >70%. These parameters were acceptable, suggesting that the human germline Ala83 is conducive to pairing with Cys80 to allow Cys80 conjugation, as seen with the xi155D5 sequence; and
6. The humanized mAb with the huIGKV7-3-Glu81 sequence contain a human germline Thr83; this mAb showed aggregation <25% after decapping (6%) and conjugation efficiency close to 100%. These parameters were acceptable, suggesting that the human germline Thr83 is conducive to pairing with Cys80 to allow Cys80 conjugation.
